import Link from  "next/link";

const linkStyle = {
    marginRight:15
};
const Header = () =>(
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>
        <Link href="/users/list">
            <a style={linkStyle}>Users</a>
        </Link>
    </div>
);

export default Header;
